import React from 'react'
function JobFilterComponent(data) {
    let filters = getFilterProperties(data);
    return (
        <div class="JobFilterFloat">
            <div className="">
                <p id="JobFilter_Title">Filter</p>
                {filters.map((key) => {
                    { console.log(key,val) }
                    <h1 id="JobFilter_items">{key}</h1>
                })}
                <div className="flexBox_column_joined">
                </div>
                <div className="JobsCardComponent_divider_second">
                </div>
            </div>
        </div>
    )
}

function getFilterProperties(data) {
    let  map= new Map();
    data.jobsData.forEach((job) => {
        map.add(job.JobCompanyName)
    })
    return map;
}

export default JobFilterComponent;
